import "./App.css";
import { Container } from "react-bootstrap";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import Homescreen from "./Screens/Homescreen";

const App = () => {
  return (
    <div className="App">
      <Header />
      <Container>
        <main className="py-3">
          <Homescreen />
        </main>
      </Container>
      <Footer />
    </div>
  );
};

export default App;
